import React, { Suspense } from 'react';
const { FontAwesomeIcon}   = React.lazy(() => import('@fortawesome/react-fontawesome'));
const { fab }  = React.lazy(() => import('@fortawesome/free-brands-svg-icons'));
const { fas }  = React.lazy(() => import('@fortawesome/free-solid-svg-icons'));
console.log(fab)
export const Facebook = props => {
    return (
        <Suspense fallback={<h1>Betöltés…</h1>}>
            <FontAwesomeIcon icon={fab.faFacebookSquare}/>  
        </Suspense>
    )
}

export const LeftArrow = props => {
    return (
        <Suspense fallback={<h1>Betöltés…</h1>}>
            <FontAwesomeIcon icon={fas.faArrowLeft}/>
        </Suspense>
    )
}
